    <script src="https://cdn.jsdelivr.net/npm/axios/dist/axios.min.js"></script>
    <script src="https://html2canvas.hertzen.com/dist/html2canvas.min.js"></script>
    <script src="./fuzzy.js"></script>
    <script>
        console.log(document.getElementById('datas'));
        const form = document.getElementById('searchForm');
        const imageList = document.getElementById('imageList');
        const datas = JSON.parse(document.getElementById('datas').innerHTML);

        const icons = datas.tree.map((icon) => {
            return {
                url: `https://raw.githubusercontent.com/Azuby-hash/IconsStore/main/${icon.path}`,
                name: icon.path
            }
        })

        form.addEventListener('submit', async function (event) {
            event.preventDefault();

            procSearch()
        });

        function procSearch() {
            const searchTerm = document.getElementById('searchTerm').value;

            searchImages(searchTerm, (results) => {
                imageList.innerHTML = ''; // Clear previous results
                results.forEach(result => {
                    const img = document.createElement('img');
                    img.src = result.url;
                    img.alt = result.name;
                    img.addEventListener('click', () => {
                        copyToClipboard(img);
                        showAlert(`Image ${result.name} copied to clipboard!`);
                    });
                    img.width = 24
                    img.height = 24
                    imageList.appendChild(img);
                });
            })
        }

        async function searchImages(searchTerm, callback) {
            const fuzzySearch = fuzzy.filter(searchTerm, icons.filter((a) => {
                return a.name.includes("png")
            }).map((a) => a.name)).map((value) => {
                for (i in icons) {
                    if (icons[i].name == value.string) {
                        return icons[i]
                    }
                }
                return icons[0]
            })

            const re = [...fuzzySearch, ...icons.filter((a) => {
                return a.name.includes("png") && a.name.includes(searchTerm)
            })]

            callback(re)
        }

        function copyToClipboard(img) {
            axios(img.src, { responseType: 'stream' })
                .then(response => response.data)
                .then(blob => {
                    const item = new ClipboardItem({ 
                        "image/png": blob
                    });
                    navigator.clipboard.write([item]);
                });
        }

        function showAlert(message) {
            const alertBox = document.createElement('div');
            alertBox.textContent = message;
            alertBox.style.position = 'fixed';
            alertBox.style.top = '10px';
            alertBox.style.left = '50%';
            alertBox.style.transform = 'translateX(-50%)';
            alertBox.style.backgroundColor = '#f0f0f0';
            alertBox.style.padding = '10px 20px';
            alertBox.style.borderRadius = '5px';
            alertBox.style.boxShadow = '0px 0px 10px rgba(0, 0, 0, 0.2)';
            document.body.appendChild(alertBox);
            setTimeout(() => {
                document.body.removeChild(alertBox);
            }, 2000);
        }
    </script>
